    for i in range(0, len(data), 2):
        rgb565 = (data[i+1] << 8) | data[i]
        # print(rgb565)
        r = (rgb565 >> 11) & 0x1F
        g = (rgb565 >> 5) & 0x3F
        b = rgb565 & 0x1F
        r = (r << 3) | (r >> 2)
        g = (g << 2) | (g >> 4)
        b = (b << 3) | (b >> 2)
        rgb888.append((r, g, b))
        print(f"{r}, {g}, {b},")
    return rgb888


